script: |
  super -f tsv -I q5590.sql | sort > q5590.out

vector: true

inputs:
  - name: q5590.sql
    data: |
      SELECT col1 * - col0 / col0 AS col2 FROM tab1 WHERE NOT + col2 + col0 IN ( - col1 * col1 * - col2 + - col0 );
  - name: tab1

outputs:
  - name: q5590.out
    data: |
      -10
      -13
      -26
